import React from 'react'
import reactStars from 'react-rating-stars-component'

export const Filter = () => {
    return (
        <div>
            <input type='text' />
            <reactStars
                        count={5}
                        edit={false}
                   // onChange={ratingChanged}
                     size={5}
                        activeColor="#ffd700"
                    
                     /> 
        </div>
    )
}
